import convert

# set up removes punctuation and converts all to lowercase for ease of use
def setUp(cipher):
    cipher = cipher.lower()
    cipher = convert.stringToArray(cipher)
    counter = 0
    valid = False
    while not valid:
        ascii = ord(cipher[counter])
        if cipher[counter] != " ":
            if ascii < 97 or ascii > 123:
                cipher.pop(counter)
            else:
                counter += 1
        else:
            counter += 1
        if counter == len(cipher):
            valid = True
    return cipher


